import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';

const Employees = () => {
  const [employees, setEmployees] = useState([
    'Kiis Béla',
    'Gipsz Jakab',
    'Nagy Miska',
    'Hortháth Panna',
  ]);

  return (
    <div className='container-sm mt-5'>
      <h1>Dolgozók</h1>
      <NavLink
        className='navbar-item nav-link'
        exact
        to='/newEmployee'
        activeClassName='activeClicked'
      >
        <button type='button' class='btn btn-dark mt-5'>
          Létrehozás
        </button>{' '}
      </NavLink>

      <select className='form-select mt-5' aria-label='Default select example'>
        <option selected>Válassz dolgozót</option>
        {employees.map(employee => (
          <option key={employee} value={employee}>
            {employee}
          </option>
        ))}
      </select>

      <div className='container-l mt-5'>
        <button type='button' class='btn btn-warning mt-5'>
          Módosítás
        </button>{' '}
        <button type='button' class='btn btn-danger mt-5'>
          Törlés
        </button>{' '}
      </div>
    </div>
  );
};

export default Employees;
